void print_angles(std::vector< double > angles)
{
    for (int i=0; i<6; i++)
    	printf("Angles %d = %f\n", i, angles[i]);
}

void print_vels(std::vector< double > vels)
{
    for (int i=0; i<6; i++)
    	printf("Velocities %d = %f\n", i, vels[i]);
}

void print_accs(std::vector< double > accs)
{
    for (int i=0; i<6; i++)
    printf("Accelerates %d = %f\n", i, accs[i]);
}

moments moments_cal(std::vector< double > angles, std::vector< double > velocities, std::vector< double > accelerates)
{
  double *tmp;
  tmp = sum(angles, velocities, accelerates);
	moments mo;
	mo.mm1 = *(tmp + 0);
	mo.mm2 = *(tmp + 1);
  mo.mm3 = *(tmp + 2);
	mo.mm4 = *(tmp + 3);
	mo.mm5 = *(tmp + 4);
	mo.mm6 = *(tmp + 5);

	return mo;
}

darray cal_gravity(double joint[6])
{
  darray gravity;
  double q1,q2,q3,q4,q5,q6;
  double S1,S2,S3,S4,S5,S6,C1,C2,C3,C4,C5,C6;
  double C23,S23, S4_6,C4_6,S4_5,C4_5,S45,C45,S46,C46;

  q1 = joint[0]*PM_PI/180;
  q2 = joint[1]*PM_PI/180;
  q3 = joint[2]*PM_PI/180;
  q4 = joint[3]*PM_PI/180;
  q5 = joint[4]*PM_PI/180;
  q6 = joint[5]*PM_PI/180;
  S1 = sin(q1);
  S2 = sin(q2);
  S3 = sin(q3);
  S4 = sin(q4);
  S5 = sin(q5);
  S6 = sin(q6);
  C1 = cos(q1);
  C2 = cos(q2);
  C3 = cos(q3);
  C4 = cos(q4);
  C5 = cos(q5);
  C6 = cos(q6);
  C23 = cos(q2 + q3);
  S23 = sin(q2 + q3);
  S45 = sin(q4 + q5);
  C45 = cos(q4 + q5);
  S46 = sin(q4 + q6);
  C46 = cos(q4 + q6);
  S4_5 = sin(q4-q5);
  S4_6 = sin(q4-q6);
  C4_5 = cos(q4-q5);
  C4_6 = cos(q4-q6);

  gravity.array2d[0][0] = 0;

  gravity.array2d[1][0] =(grav*(2*a2*m_2*C2 + 2*a2*m_3*C2 + 2*a2*m_4*C2 + 2*a2*m_5*C2 + 2*a2*m_6*C2 - 2*Y2*m_2*S2 + 2*X3*m_3*C23 + 2*a3*m_3*C23 + 2*a3*m_4*C23 + 2*a3*m_5*C23 + 2*a3*m_6*C23 - 2*Y4*m_4*S23 + 2*Z3*m_3*S23 + 2*d4*m_4*S23 + 2*d4*m_5*S23 + 2*d4*m_6*S23 + 2*X2*m_2*C2 + X5*m_5*C23*C45 + X6*m_6*C23*C46 - Y6*m_6*C23*S46 + Z5*m_5*C23*S45 + Z6*m_6*C23*S45 + d6*m_6*C23*S45 + 2*X4*m_4*C23*C4 - 2*Y5*m_5*C23*S4 - 2*Z4*m_4*C23*S4 + 2*Z5*m_5*S23*C5 + 2*Z6*m_6*S23*C5 + 2*d6*m_6*S23*C5 - 2*X5*m_5*S23*S5 + X5*m_5*C4_5*C23 - X6*m_6*C4_6*C23 - Y6*m_6*S4_6*C23 - Z5*m_5*S4_5*C23 - Z6*m_6*S4_5*C23 - d6*m_6*S4_5*C23 + X6*m_6*C23*C45*C6 - Y6*m_6*C23*C45*S6 - 2*X6*m_6*S23*C6*S5 + X6*m_6*C4_5*C23*C6 + 2*Y6*m_6*S23*S5*S6 - Y6*m_6*C4_5*C23*S6))/2;

  gravity.array2d[2][0] = X3*grav*m_3*C23 + a3*grav*m_3*C23 + a3*grav*m_4*C23 + a3*grav*m_5*C23 + a3*grav*m_6*C23 - Y4*grav*m_4*S23 + Z3*grav*m_3*S23 + d4*grav*m_4*S23 + d4*grav*m_5*S23 + d4*grav*m_6*S23 + X4*grav*m_4*C23*C4 - Y5*grav*m_5*C23*S4 - Z4*grav*m_4*C23*S4 + Z5*grav*m_5*S23*C5 + Z6*grav*m_6*S23*C5 + d6*grav*m_6*S23*C5 - X5*grav*m_5*S23*S5 + Y6*grav*m_6*S23*S5*S6 + X5*grav*m_5*C23*C4*C5 - Y6*grav*m_6*C23*C6*S4 + Z5*grav*m_5*C23*C4*S5 + Z6*grav*m_6*C23*C4*S5 + d6*grav*m_6*C23*C4*S5 - X6*grav*m_6*C23*S4*S6 - X6*grav*m_6*S23*C6*S5 + X6*grav*m_6*C23*C4*C5*C6 - Y6*grav*m_6*C23*C4*C5*S6;

  gravity.array2d[3][0] = -grav*S23*(X4*m_4*S4 + Y5*m_5*C4 + Z4*m_4*C4 + Y6*m_6*C4*C6 + X5*m_5*C5*S4 + X6*m_6*C4*S6 + Z5*m_5*S4*S5 + Z6*m_6*S4*S5 + d6*m_6*S4*S5 + X6*m_6*C5*C6*S4 - Y6*m_6*C5*S4*S6);

  gravity.array2d[4][0] = grav*m_5*(X5*C23*C5 + Z5*C23*S5 + Z5*S23*C4*C5 - X5*S23*C4*S5) + grav*m_6*(Z6*C23*S5 + d6*C23*S5 + X6*C23*C5*C6 - Y6*C23*C5*S6 + Z6*S23*C4*C5 + d6*S23*C4*C5 + Y6*S23*C4*S5*S6 - X6*S23*C4*C6*S5);

  gravity.array2d[5][0] = -grav*m_6*(Y6*(C23*C6*S5 - S23*S4*S6 + S23*C4*C5*C6) + X6*(S23*C6*S4 + C23*S5*S6 + S23*C4*C5*S6));

  return(gravity);
}

