darray rne(double joint[6], double dq[6], double ddq[6])
{
	int row,k;
	darray torque;
	darray masseffect;
	darray gravity = cal_gravity(joint);
	darray coriolis = cal_coriolis(joint,dq);
	darray inertiamatrix = cal_inertia(joint);
	for (row = 0; row<6; row++)
	{
		masseffect.array2d[row][0] = 0;
		for (k=0;k<6;k++)
		{
		masseffect.array2d[row][0] += inertiamatrix.array2d[row][k]*ddq[k];
		}
	}
	for (row = 0; row<6; row++)
	{
		torque.array2d[row][0] = masseffect.array2d[row][0]+gravity.array2d[row][0]+coriolis.array2d[row][0];
	}

	return torque;
}

double* sum(std::vector< double > a, std::vector< double > b, std::vector< double > c)
{
  static double tmp[6];
  double join_angle[6], joint_vel[6], joint_acc[6];

  for (int i = 0; i<6; i++)
  {
    join_angle[i] = a[i];
    joint_vel[i] = b[i];
    joint_acc[i] = c[i];
  }

  //printf("----------Gravity Matrix-----------\n");
  darray gravity = cal_gravity(join_angle);
  /*
  for (int i = 0; i<6; i++)
  {
    printf("%f\n", gravity.array2d[i][0]);
  }*/

  //printf("----------Coriolis Matrix-----------\n");
  darray coriolis = cal_coriolis(join_angle, joint_vel);
  /*
  for (int i = 0; i<6; i++)
  {
    printf("%f\n", coriolis.array2d[i][0]);
  }*/

  //printf("----------Inertia Matrix-----------\n");
  darray inertia = cal_inertia(join_angle);
  /*
  for (int i = 0; i<6; i++)
  {
    for (int j = 0; j<6; i++)
    {
      printf("%f       ", inertia.array2d[i][j]);
    }
    printf("\n");
  }*/

  //printf("----------Torque Matrix-----------\n");
  darray torque = rne(join_angle, joint_vel, joint_acc);
  /*
  for (int i = 0; i<6; i++)
  {
    printf("%f\n", torque.array2d[i][0]);
  }*/

  for (int i = 0; i < 6; i++)
    tmp[i] = torque.array2d[i][0];

  return tmp;
}
